import React from 'react';
import "./styles.scss";

export class LaunchImage extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            links: props.links
        }
    }

    render(){
        return(
            <>
                {this.props.links.flickr_images.length>0 ? <img src={this.props.links.flickr_images[0]} alt="flickr" className="launchImg"></img>:<img src={this.props.links.mission_patch} alt="mission patch" className="launchImg"></img>}
            </>
        );
    }
}
